VALUES (2, 'massage', 'massage', TRUE, TIMESTAMP '2021-01-06 06:21:45.597851', TIMESTAMP '2021-04-19 10:15:17.105594', '{"sections":[{"textColor":"#ffffff","background":{"skew":0,"image":"/images/bg-hero-massage01.jpeg","repeat":"no-repeat","position":"center","size":"cover","attachment":"fixed"},"blocks":[{"text":{"title":"Geef Jezelf Het Beste","html":"\u003Ch2\u003EGun Jezelf Het Beste\u003Cbr/\u003E En Geniet Van Een Ontspannende Massage\u003C/h2\u003E\n\u003Cp\u003E\nBij Highlihgts staan we voor jouw resultaten en voor jouw kwaliteit van leven. Het is onze missie om jou alles te geven wat je nodig hebt voor het beste resultaat. De wetenschap zegt dat je na het trainen een massage nodig hebt. Een massage versnelt niet alleen je herstel. Maar het draagt ook -na je workout- bij aan het verbeteren van je spierkracht. oftewel, je wordt sterker! Na een training het melkzuur uit je spieren masseren is dus niet alleen ontspannend, maar vooral ook heel effectief. Stel je voor... na je 20 minuten intensieve workout een heerlijk onspannende massage. Wij verzorgen het voor jou! \n\u003C/p\u003E"}}]},{"background":{"skew":0},"blocks":[{"image":{"title":"training","src":"/images/highlights-massage01.jpeg","width":500,"height":500,"shadow":true,"accent":false}},{"text":{"title":"Kom Tot Rust","html":"\u003Ch3\u003EKom Tot Rust En Verbeter Je Welzijn\u003C/h3\u003E\n\u003Cp\u003EJOUW LICHAAM, JOUW WELZIJN\u003C/p\u003E\n\u003Ctable\u003E\n\u003Ctr\u003E\u003Ctd\u003E\u0026#10003;\u003C/td\u003E\u003Ctd\u003EActiveert je zelfhelend vermogen\u003C/td\u003E\u003C/tr\u003E\n\u003Ctr\u003E\u003Ctd\u003E\u0026#10003;\u003C/td\u003E\u003Ctd\u003EVermindert stress\u003C/td\u003E\u003C/tr\u003E\n\u003Ctr\u003E\u003Ctd\u003E\u0026#10003;\u003C/td\u003E\u003Ctd\u003EVerhoogt je weerstand\u003C/td\u003E\u003C/tr\u003E\n\u003Ctr\u003E\u003Ctd\u003E\u0026#10003;\u003C/td\u003E\u003Ctd\u003E\u200BOntknoopt en voert afvalstoffen af\u003C/td\u003E\u003C/tr\u003E\n\u003Ctr\u003E\u003Ctd\u003E\u