\u003C/h4\u003E\u003Ch4 class=\u0027text-center italic text-base\u0027 style=\u0027color: #E5E7EB;\u0027\u003E\u0022Fit lichaam en rust in mijn hoofd\u0022\u003C/h4\u003E\u003Cp class=\u0027text-center text-sm text-gray-300\u0027\u003EIk heb een extreem drukke baan. Bij Highlights helpen ze me niet alleen om de beste versie van mezelf te zijn maar ook om volledig te ontspannen. Ik train, heb een goed voedingspatroon en de massages zorgen ervoor dat ik zowel lichamelijk als geestelijk volledig tot rust kom. Het is precies wat ik nodig heb om goed te kunnen functioneren in het dagelijks leven.\u003C/p\u003E"}}]},{"blocks":[{"card":{"imageSrc":null,"accent":true,"title":"30 MINUTEN","html":"\u003Ch4\u003E30 MINUTEN LICHAAMSMASSAGE\u003C/h4\u003E\n\u003Ch1\u003E\u20AC35,-\u003C/h1\u003E\n\u003Ch4\u003EPer behandeling\u003C/h4\u003E"}},{"card":{"imageSrc":null,"accent":true,"title":"60 MINUTEN","html":"\u003Ch4\u003E60 MINUTEN LICHAAMSMASSAGE\u003C/h4\u003E\n\u003Ch1\u003E\u20AC 60,-\u003C/h1\u003E\n\u003Ch4\u003EPer behandeling\u003C/h4\u003E"}}]}]}');

