VALUES (3, 'ems training', 'ems-training', TRUE, TIMESTAMP '2021-01-06 06:21:45.597851', TIMESTAMP '2021-04-19 10:15:17.105594', '{"sections":[{"textColor":"#ffffff","background":{"skew":0,"image":"/images/bg-hero-ems03.jpeg","repeat":"no-repeat","position":"center","size":"cover","attachment":"fixed"},"blocks":[{"text":{"title":"Bespaar tijd","html":"\u003Cbr/\u003E\u003Ch2\u003EBespaar tijd met EMS Training\u003C/h2\u003E\n\u003Cp\u003EDoor middel van onze revolutionaire trainingsmethode bieden wij je een blijvende oplossing als het gaat om afslanken en een fittere en gezondere levensstijl. Je wordt vanaf het begin tot aan uw doel begeleid.\u003C/p\u003E\u003Cbr/\u003E"}},{"youtube":{"videoId":"wztqZ7h_i1E","title":"promo","width":481,"height":568,"shadow":true,"accent":false}}]},{"background":{"skew":0},"blocks":[{"image":{"title":"ems traning","src":"/images/highlights-ems01.png","width":0,"height":0,"shadow":true,"accent":false}},{"text":{"title":"Gegarandeerd Resultaat","html":"\u003Ch3\u003EVoelen Is Geloven\u003C/h3\u003E\n\u003Ctable\u003E\n\u003Ctr\u003E\u003Ctd\u003E\t\u0026#10003;\u003C/td\u003E\u003Ctd\u003EUnieke trainingsmethode op maat \u200B\u003C/td\u003E\u003C/tr\u003E\n\u003Ctr\u003E\u003Ctd\u003E\t\u0026#10003;\u003C/td\u003E\u003Ctd\u003EMakkelijk te integreren in je huidige levensstijl \u200B\u003C/td\u003E\u003C/tr\u003E\n\u003Ctr\u003E\u003Ctd\u003E\t\u0026#10003;\u003C/td\u003E\u003Ctd\u003EGeschikt voor alle leeftijden vanaf 18 jaar \u200B\u003C/td\u003E\u003C/tr\u003E\n\u003Ctr\u003E\u003Ctd\u003E\t\u0026#10003;\u003C/td\u003E\u003Ctd\u003E46% Effectiever dan traditionele trainingen\u003C/td\u003E\u003C/tr\u003E\n\u003Ctr\u003E\u003Ctd\u003E\t\u0026#10003;\u003C/td\u003E\u003Ctd\u003EPersoonlijke begeleiding \u200B\u003C/td\u003E\u003C/tr\u003E\n\u003Ctr\u003E\u003Ctd\u003E\t\u0026#10003;\u003C/td\u003E\u003Ctd\u003E\u200BPopulair onder topsporters en celebrities \u200B\u003C/td\u003E\u003C/tr\u003E\n\u003Ctr\u003E\u003Ctd\u003E\t\u0026#10003;\u003C/td\u003E\u003Ctd\u003EOok geschikt bij blessures en/of medische aandoeningen (vraag naar de mogelijkheden)\u003C/td\u003E\u003C/tr\u003E\n\u003C/table\u003E"}}]},{"textColor":"#ffffff","background":{"skew":-3,"image":"/images/abstract-10.png","repeat":"repeat","position":"center","size":"cover","attachment":""},"blocks":[{"text":{"title":" 8 Spiergroepen","html":"\u003Ch3 style=\u0022text-align: center;\u0022\u003E\u0026nbsp;- 8 Spiergroepen -\u003C/h3\u003E\n\u003Cp style=\u0022text-align: center;\u0022\u003EActiveer Alle Belangrijke Spiergroepen Tegelijkertijd\u0026nbsp;\u003C/p\u003E"}},{"text":{"title":"515 Calorien","html":"\u003Ch3 style=\u0022text-align: center;\u0022\u003E- 515 Calorien -\u003C/h3\u003E\n\u003Cp style=\u0022text-align: center;\u0022\u003ENa Een Full Body EMS Workout Heb Je 515 Calorien Verbrand\u003C/p\u003E"}},{"text":{"title":"20 Minute","html":"\u003Ch3 style=\u0022text-align: center;\u0022\u003E- 20 Minuten -\u003C/h3\u003E\n\u003Cp style=\u0022text-align: center;\u0022\u003EStaat Gelijk Aan 3 Uur Trainen In De Sportschool\u0026nbsp;\u003C/p\u003E"}}]},{"blocks":[{"text":{"title":"Ons Bewezen Programma","html":"\u003Ch3\u003EOns Bewezen Programma Is Voor Iedereen Die Wil Afvallen En Sterker Wil Worden...\u003C/h3\u003E\n\u003Cp\u003EHet omzetten van lichaamsvet in spiermassa is een veel voorkomend doel. \n\tSpiermassa cre\u0026euml;ren is essentieel bij het verbranden van lichaamsvet.\n\tHieronder de 4 manieren waarop je bij HIGHLIGHTS jouw lichaamsvet verbrandt!\n\u003C/p\u003E\n\u003Col\u003E\n\t\u003Cli\u003EOefeningen kosten energie! Dit komt deels uit wat je eet, maar ook deels vanuit jouw lichaamsvet!\u003C/li\u003E\n\t\u003Cli\u003E\u200BNa de training hersteld je lichaam. Het kost je lichaam veel energie om je spieren te laten herstellen.\u003C/li\u003E\n\t\u003Cli\u003E\u200BZodra je lichaam spiermassa opbouwt heeft het meer energie nodig om je spiermassa te onderhouden! Hierdoor blijft je lichaam het lichaamsvet verbranden.\u003C/li\u003E\n\t\u003Cli\u003E\u200BKrachttraining zorgt ervoor dat je hormonen beter in balans komen. Goede hormoonbalans bevordert de vetverbranding.\u003C/li\u003E\n\u003C/ol\u003E"}},{"image":{"title":"example training","src":"/images/highlights-training01.jpeg","width":400,"height":400,"shadow":true,"accent":false}}]},{"textColor":"#ffffff","background":{"skew":3,"image":"/images/abstract-00.jpeg","repeat":"no-repeat","position":"center","size":"cover","attachment":"fixed"},"blocks":[{"text":{"title":"Wat is EMS? ","html":"\u003Ch2 style=\u0022text-align: center;\u0022\u003EWat is EMS?\u003C/h2\u003E\n\u003Cp\u003EDe afkorting \u0026lsquo;EMS\u0026rsquo; staat voor elektrische spierstimulatie of elektromyostimulatie. Dit is een trainingsprogramma waarin de spieren worden gestimuleerd en versterkt door elektroden die in een pak zijn verwerkt. Het pak en dus ook de elektroden zijn verbonden met een extern trainingsapparaat.\u0026nbsp; De intensiteit van de elektrische impuls kan via het EMS-apparaat naar eigen wens worden aangepast voor elk van de 12 elektrodeparen. In onze EMS-apparaten is al een meetfunctie ge\u0026iuml;ntegreerd, die je in realtime laat zien welke belasting jouw spieren ervaren door de stimulatie.\u003C/p\u003E"}}]},{"textColor":"#ffffff","background":{"skew":3,"image":"/images/abstract-00.jpeg","repeat":"no-repeat","position":"center","size":"cover","attachment":"fixed"},"blocks":[{"image":{"title":"ems training workout","src":"/images/highlights-training04.jpeg","width":600,"height":400,"accent":true}},{"text":{"title":"EMS is functioneel trainen","html":"\u003Cp\u003EEMS is functioneel trainen, je verbetert jouw uithoudingsvermogen, kracht stabiliteit, snelheid en flexibiliteit in een tijdsduur van 20 minuten.\u003C/p\u003E\n\n\u003Cp\u003E\tWaarbij in vele andere trainingsoefeningen je gebruik moet maken van kettlebels, speedladders, powerchains, etc is dat hier niet van toepassing. \nJe minimaliseert uitwendige belasting wat tot geen blessure leidt.\nBij alle oefeningen wordt het hele lichaam getraind.\nJe kracht en conditie gaan razendsnel vooruit. Door de hoge intensiteit blijft de calorieverbranding zelfs lange tijd na de training verhoogd.\u003C/p\u003E\n\n\u003Cp\u003EIs EMS wat voor mij?\u003C/p\u003E\n\u003Cp\u003EEMS is functioneel trainen en is daarmee heel toegankelijk. Iedereen kan op eigen niveau trainen, hiervoor hoef je geen ervaren sporter te zijn. \nVoordeel is dat jij sneller je doel zal behalen omdat de focus gedurende de training op JOU ligt.\u003C/p\u003E\n"}}]},{"blocks":[{"text":{"title":"Onze  onderbouwde methode","html":"\u003Cp\u003EOnze wetenschappelijk onderbouwde methode helpt mannen en vrouwen in Gelderland en Overijssel om buitengewone resultaten te behalen\u003C/p\u003E"}}]},{"blocks":[{"text":{"title":"Voor uw kwaliteit van leven","html":"\u003Ch3\u003EVoor uw kwaliteit van leven\u0026nbsp;\u003C/h3\u003E\n\u003Cp\u003EZelfkennis en zelfreflectie zijn misschien wel d\u0026eacute; belangrijkste kenmerken van een gelukkig leven. In de spiegel kunnen kijken en eerlijk tegen jezelf zijn is enorm krachtig. Uit ervaring weten we dat mensen die niet alleen doelen kunnen stellen maar ook de afspraken met zichzelf kunnen nakomen het gelukkigst zijn. Bij Highlights weten we dat dit niet altijd even makkelijk is en daarom zweren we ook bij persoonlijke begeleiding voor iedereen. Merk je dat je moeite hebt met afspraken met jezelf nakomen? Boek je gratis intake, wij helpen je!\u0026nbsp;\u003C/p\u003E"}},{"text":{"title":"Waarom Highlights?","html":"\u003Ch2\u003EWaarom Highlights?\u003C/h2\u003E\n\u003Cul\u003E\n\u003Cli\u003EPersoonlijke begeleiding door professionals\u0026nbsp;\u003C/li\u003E\n\u003Cli\u003E\u200BWij kijken naar jou en je doelen en nemen je van A-Z mee in de reis naar jouw doel\u003C/li\u003E\n\u003Cli\u003E\u200BDe kern bij Highlights is jou blijvend in je kracht zetten met onze Unieke Methode\u003C/li\u003E\n\u003C/ul\u003E"}}]},{"textColor":"#ffffff","background":{"skew":3,"image":"/images/abstract-10.png","repeat":"repeat","position":"center","size":"cover"},"blocks":[{"text":{"title":"7 jaar","html":"\u003Ch2 class=\u0027text-center\u0027\u003E7 Jaar\u003Cbr/\u003EErvaring\u003C/h2\u003E"}},{"text":{"title":"550\u002B","html":"\u003Ch2 style=\u0022text-align: center;\u0022\u003E550 \u002B\u003Cbr/\u003ETevreden Klanten\u003C/h2\u003E"}},{"text":{"title":"70.000\u002B","html":"\u003Ch2 style=\u0022text-align: center;\u0022\u003E70.000 \u002B\u003Cbr/\u003EGegeven Trainingen\u003C/h2\u003E"}}]},{"blocks":[{"text":{"title":"We Werken Met Een Beperkt Aantal Klanten","html":"\u003Ch3 class=\u0027text-center\u0027\u003EWe Werken Met Een Beperkt Aantal Klanten\u003C/h3\u003E\n\u003Cp\u003E\nWij zijn gericht op resultaat, jouw resultaat. Dat betekent dat wij een volledig persoonlijk stappenplan maken en je vanaf het begin tot het eind begeleiden. In onze EMS studio train je alleen, met zijn twee\u00EBn of in een kleine groep tot max. 4 - 6 personen onder begeleiding van jouw personal trainer. Kwaliteit vraagt om aandacht. \n\u003C/p\u003E\n\u003Cp\u003E\nWij werken alleen met gemotiveerde klanten, klanten die hun doelen echt willen behalen. Tijdens de intake bespreken we of we een goede fit zijn en met elkaar naar jouw doelen kunnen gaan werken.\n\u003C/p\u003E"}}]}]}');

