INSERT INTO "PsiderPageData" ("Id", "Title", "Slug", "Published", "CreatedAt", "ModifiedAt", "Content")
VALUES (5, 'figuur correctie', 'figuur-correctie', TRUE, TIMESTAMP '2021-01-06 06:21:45.597851', TIMESTAMP '2021-04-19 10:15:17.105594', '{"sections":[{"textColor":"#ffffff","background":{"skew":0,"image":"https://images.unsplash.com/photo-1519668752166-ebdbfe986afd?ixlib=rb-1.2.1\u0026q=80\u0026fm=jpeg\u0026crop=entropy\u0026cs=tinysrgb\u0026w=1080\u0026fit=max\u0026ixid=eyJhcHBfaWQiOjcyMTUyfQ","repeat":"no-repeat","position":"center","size":"cover","attachment":"fixed"},"blocks":[{"text":{"title":"QB Lipo","html":"\u003Ch2\u003EQB Lipo Is Voor Iedereen\u003C/h2\u003E\n\u003Cp\u003EMet een gezond gewicht die graag een of meerdere vetrolletjes voorgoed ziet verdwijnen. Met QB Lipo verwijder je de hardnekkige zones waar vet ligt opgeslagen die niet weggaan met alleen een dieet of intensief sporten. Het vet verdwijnt precies waar jij dat wilt, op de buik, benen, armen, rug en taille.\u003Cp\u003E"}}]},{"blocks":[{"image":{"title":"figuur 2","src":"/images/highlights-figuur02.png","width":0,"height":0,"shadow":true,"accent":true}},{"text":{"title":"Vet Verdwijnt","html":"\u003Ch3\u003EVet Verdwijnt Waar Jij Dat Wil\u003C/h3\u003E\n\u003Ctable\u003E\n\u003Ctr\u003E\u003Ctd\u003E\u0026#10003;\u003C/td\u003E\u003Ctd\u003EDirect meetbaar resultaat\u003C/td\u003E\u003C/tr\u003E\n\u003Ctr\u003E\u003Ctd\u003E\u0026#10003;\u003C/td\u003E\u003Ctd\u003EDoelgerichte aanpak zoals buik, heupen, benen, rug, taille\u003C/td\u003E\u003C/tr\u003E\n\u003Ctr\u003E\u003Ctd\u003E\u0026#10003;\u003C/td\u003E\u003Ctd\u003EReductie van Cellulitis\u003C/td\u003E\u003C/tr\u003E\n\u003Ctr\u003E\u003Ctd\u003E\u0026#10003;\u003C/td\u003E\u003Ctd\u003EKorte behandeltijd van maximaal 45 minuten\u003C/td\u003E\u003C/tr\u003E\n\u003Ctr\u003E\u003Ctd\u003E\u0026#10003;\u003C/td\u003E\u003Ctd\u003EGeen medische ingreep - geen bijwerkingen\u003C/td\u003E\u003C/tr\u003E\n\u003Ctr\u003E\u003Ctd\u003E\u0026#10003;\u003C/td\u003E\u003Ctd\u003EBewezen effectief\u003C/td\u003E\u003C/tr\u003E\n\u003C/table\u003E"}}]},{"textColor":"#ffffff","background":{"skew":-3,"image":"/images/abstract-00.jpeg","repeat":"no-repeat","position":"center","size":"cover","attachment":"fixed"},"blocks":[{"text":{"title":"8 Redenen","html":"\n\u003Ch3\u003E8 Redenen Om Deze Bewezen Effectieve Methode Toe Te Passen\u003C/h3\u003E\n\u003Cp\u003E\n\u003Col\u003E\n\u003Cli\u003EMijn gewicht is prima, maar ik heb toch een buikje\u003C/li\u003E\n\u003Cli\u003EIk wil graag mijn figuur terug van voor mijn zwangerschap\u003C/li\u003E\n\u003Cli\u003EIk zoek een behandeling met blijvend resultaat\u003C/li\u003E\n\u003Cli\u003EIk wil graag meer zichtbaarheid van mijn spieren\u003C/li\u003E\n\u003Cli\u003EIk hou niet van naalden en wil ook geen liposuctie\u003C/li\u003E\n\u003Cli\u003EIk wil dat mijn kleding perfect past\u003C/li\u003E\n\u003Cli\u003EDeze zomer wil ik eindelijk die bikini body\u003C/li\u003E\n\u003Cli\u003ENaarmate ik ouder wordt kost het meer moeite om strak te blijven\u003C/li\u003E\n\u003C/ol\u003E\u003C/p\u003E"}},{"image":{"title":"example training","src":"/images/highlights-figuur03.png","width":600,"height":400,"accent":false}}]},{"blocks":[{"text":{"title":"Hoe het werkt","html":"\u003Ch3\u003EHoe het werkt\u003C/h3\u003E\n\u003Cp\u003EWil je plaatselijk afslanken, definitief afrekenen met probleemzones zoals een buikje, lovehandles, zadeltassen, vetophoppingen of cellulite?\u003C/p\u003E\n\u003Cp\u003ECavitatie is de manier om vet veilig, pijnloos en met blijvend resultaat te verwijderen. Laagfrequent ultrasone geluidsgolven maken allereerst het overtollige lichaamsvet vrij. Vervolgens wordt het vet op een geheel natuurlijke manier afgebroken en afgevoerd. Dat alles maakt cavitatie tot het beste alternatief voor liposuctie.\u003C/p\u003E\n\u003Cp\u003EOnze klanten boeken deze figuurcorrectie behandeling  vaak in combinatie met EMS training voor het ultieme resultaat.\u003C/p\u003E"}},{"image":{"title":"figuur","src":"/images/highlights-figuur04.jpeg","width":400,"height":400,"shadow":true,"accent":false}}]},{"textColor":"#ffffff","background":{"skew":3,"image":"/images/abstract-10.png","repeat":"repeat","position":"center","size":"cover"},"blocks":[{"text":{"title":"7 jaar ","html":"\u003Ch3 style=\u0022text-align: center;\u0022\u003E45 minuten\u003C/h3\u003E\n\u003Cp style=\u0022text-align: center;\u0022\u003EDoelgerichte aanpak van probleemgebieden\u003C/p\u003E"}},{"text":{"title":"550\u002B","html":"\u003Ch3 style=\u0022text-align: center;\u0022\u003EPijnloos en Betaalbaar\u003C/h3\u003E\n\u003Cp style=\u0022text-align: center;\u0022\u003EZonder inspanning \nof ingreep\u003C/p\u003E"}},{"text":{"title":"70.000\u002B","html":"\u003Ch3 style=\u0022text-align: center;\u0022\u003EBewezen effectief\u003C/h3\u003E\n\u003Cp style=\u0022text-align: center;\u0022\u003EMeetbare resultaten vanaf de eerste behandeling\u003C/p\u003E"}}]},{"blocks":[{"text":{"title":"Weg Met Overtollig Vet","html":"\u003Ch3 class=\u0027text-center\u0027\u003EWeg Met Overtollig Vet\u003C/h3\u003E\n\u003Cp\u003E\nSpieren worden pas echt goed zichtbaar als er weinig tot geen vet op de betreffende lichaamszone zit. Vermindering van vet en vetophopingen zorgt ervoor dat bijvoorbeeld de buikspieren beter zichtbaar worden. Bij Highlights zijn we gericht op jouw doelen en jouw resultaat. Daarom is QB Lipo goed te combineren met EMS Training. Terwijl we jouw spieren meer ontwikkelen met EMS training kunnen we met QB Lipo net dat zetje extra geven en probleemzones aanpakken voor een optimaal resultaat.\u003C/p\u003E"}}]},{"blocks":[{"image":{"title":"example training","src":"/images/highlights-figuur05.jpeg","width":300,"height":200,"shadow":false,"accent":false}},{"image":{"title":"example training","src":"/images/highlights-figuur06.jpeg","width":300,"height":200,"shadow":false,"accent":false}},{"image":{"title":"example training","src":"/images/highlights-figuur07.jpeg","width":300,"height":200,"shadow":false,"accent":false}}]},{"textColor":"#ffffff","background":{"skew":-3