VALUES (6, 'small group', 'small-group', TRUE, TIMESTAMP '2021-01-06 06:21:45.597851', TIMESTAMP '2021-04-19 10:15:17.105594', '{"sections":[{"textColor":"#ffffff","background":{"skew":0,"image":"/images/bg-hero-smallgroup01.jpeg","repeat":"no-repeat","position":"center","size":"cover","attachment":"fixed"},"blocks":[{"text":{"title":"Small Group Training","html":"\u003Ch3\u003ESmall Group Training\u003C/h3\u003E\n\u003Cp\u003EIs Personal Training net een stapje te ver? Dan past Small Group Personal Training wellicht beter bij jou. Met deze training sport je in een kleine groep van 4 tot 6 personen en ervaar je toch de motivatie en coaching die een Personal Trainer je kan bieden. Aandacht, resultaat en fun staan te allen tijde centraal.\u003C/p\u003E"}},{}]},{"background":{"skew":0},"blocks":[{"image":{"title":"training","src":"/images/highlights-training01.jpeg","width":0,"height":0,"shadow":true,"accent":false}},{"text":{"title":"Voordelen van small group","html":"\u003Ch3\u003EDe voordelen van small group training\u003C/h3\u003E\n\u003Ctable\u003E\n\u003Ctr\u003E\u003Ctd\u003E\u0026#10003;\u003C/td\u003E\u003Ctd\u003EMotivatie en coaching door een Personal Trainer\u003C/td\u003E\u003C/tr\u003E\n\u003Ctr\u003E\u003Ctd\u003E\u0026#10003;\u003C/td\u003E\u003Ctd\u003E\u200BKort maar krachtig\u003C/td\u003E\u003C/tr\u003E\n\u003Ctr\u003E\u003Ctd\u003E\u0026#10003;\u003C/td\u003E\u003Ctd\u003E\u200BSamen motiveert\u003C/td\u003E\u003C/tr\u003E\n\u003Ctr\u003E\u003Ctd\u003E\u0026#10003;\u003C/td\u003E\u003Ctd\u003E\u200BPlezier door het gezamenlijk sporten\u003C/td\u003E\u003C/tr\u003E\n\u003Ctr\u003E\u003Ctd\u003E\u0026#10003;\u003C/td\u003E\u003Ctd\u003E\u200BZowel kracht als conditie training\u003C/td\u003E\u003C/tr\u003E\n\u003Ctr\u003E\u003Ctd\u003E\u0026#10003;\u003C/td\u003E\u003Ctd\u003E\u200BEfficient en effectief\u003C/td\u003E\u003C/tr\u003E\n\u003C/table\u003E"}}]},{"textColor":"#ffffff","background":{"skew":-3,"image":"/images/abstract-00.jpeg","repeat":"no-repeat","position":"center","size":"cover","attachment":"fixed"},"blocks":[{"text":{"title":"In een groep","html":"\u003Ch3\u003EIn een groep en toch jouw persoonlijke begeleiding\u003C/h3\u003E\n\u003Cp\u003E\nDoordat je traint in een kleine groep kan de Personal Trainer goed rekening houden met jouw persoonlijke doelstelling en jou hier persoonlijk op coachen en motiveren om maximaal resultaat uit je training te halen. Je traint dus samen en kan toch de persoonlijke begeleiding genieten. Aandacht, resultaat en fun staan altijd centraal! \n\u003C/p\u003E"}},{"image":{"title":"example training","src":"/images/highlights-training04.jpeg","width":500,"height":300,"accent":false}}]}]}');

